/** @format */

import logo from "./logo.svg";

function App() {
	return;
	<>
		<div class="mb-3">
			<label for="exampleFormControlTextarea1" class="form-label">
				Example textarea
			</label>
			<textarea
				class="form-control"
				id="exampleFormControlTextarea1"
				rows="3"
			></textarea>
		</div>
	</>;
}

export default App;
